  03> JACKSON, Dorothy Elizabeth Josephine m on 25.07.1992 to DRUCE, David
  b 15.09.1930
  b 28.11.1922
  Josephine b. at Hastings. Address: RD 1, Woodville 5473.
  Josephine is a retired farmer, jersey cattle breeder and judge.
  02> WILLIAMS, Samuel Roy m on 04.07.1924 to BURR, Bessie Joyce
  b 07.02.1893 d ** ** 1969
  b ** **. 1894 d ****.1963
  Samuel b. at Te Aute. He was educated at Huntley School, Wanganui Collegiate School and Caius College,
  Cambridge where he obtained a BA and rowed in the University eight trials in 1919. He served in the King
  Edward Horse Regiment in wwi and returned to farm "Mangakuri" Station.
  01> WILLIAMS, William John Samuel
  b 08.01.1926 d ** **.1950
  William b. at Hastings. He was educated at Canterbury University (BA) then went farming at "Te Aute"
  station. He was drowned in a yachting accident.
  02> WILLIAMS, Patrick Gordon m on ** ** **** to WANKLYN, Janet May
  b 25.09.1927
  b 05.08.1935
  Patrick b. at Pukehou and m. at Auckland. Janet, d/o Arthur Wanklyn and Molly Good. Address: Mangakuri,
  RD 14, Hastings.
  Patrick was educated at Hereworth School, Wanganui Collegiate School and Lincoln College. He served in
  the 16th New Zealand Field Regiment in the Korean War and was then a farmer on "Te Aute" and
  "Mangakuri" stations. He was later a journalist and is now retired.
  03> WILLIAMS, Jennifer Mary
  b 21.08.1931 d **.10.1988
  Jennifer b, at Hastings, d, at Palmerston North and bd. at Pukehou. She was educated at Chilton St
  James and became a Karitane nurse.
  03> WILLIAMS, Esther Margarita m on 21.06.1921 to AVERY, Norman Alfred
  b 20.03.1895 d **.09.1978
  b 01.12.1898 d 14.06.1983
  Esther b. at Te Aute, Esther and Norman owned and farmed "Pukekura" station, Havelock North. Norman served
  in the RFC RAF in Wwi and in the RNZAF in ww2.
  01> AVERY, (dau)
  b ** ** 1922 d ** **.1922
  02> AVERY, Elizabeth Anne m on 26.01.1949 to COTCHING, Nigel MacKenzie
  b 02.04.1929
  b 21.04.1920
  Elizabeth b. in London and m. at Christ Church, Pukehou. Nigel, s/o Capt Charles Edward Cotching (b.
  07.03.1880 in England, m. 30.08.1910 in Vancouver, d. 1958 in NZ, Seaforth Highlander, farmer in
  Canada, brewery manager in Scotland) and Edith Jefferd (b. 1885, d. 12.02.1925). Nigel was b. at
  Stirling, Scotland. Address: RD 1, Russell, Bay of Islands.
  Nigel saw action in WW2 in the 2nd NZEF, serving in the Pacific, the Middle East and Italy. Later he
  commanded the Hawkes Bay Regiment. Nigel was a farmer.
  01> COTCHING, Helen Edith m on 06.08.1977 to HAY, Kenneth David
  b 20.08.1950
  b 11.10.1940
